import "./TradeItem.css";

function TradeItem() {

const tradeDate = new Date(2023, 2, 21);
const tradeTicker = 'OLX';
const tradeName = 'Orignal Low X';
const tradePnl = 45;


  return (
    <div className="trade-item">
      <div>{tradeDate.toDateString()}</div>
      <div className="trade-item__description">
        <h2>${tradeName}</h2>
        <h2>${tradeTicker}</h2>
        <div className="trade-item__pnl">${tradePnl}</div>
      </div>
    </div>
  );
}

export default TradeItem;
